description:
関東～関西は送料無料。<BR>
東北、中国、四国は+140円。<BR>
九州は+250円。北海道は+550円。<BR>
沖縄県は+2050円です。<BR>
<BR>
前向き抱っこができるエルゴが新登場です！<BR>
<BR>
使用期間：首がすわる頃～<br>
耐荷重：15kg<br>
ウエストベルトサイズ：66～132cm<br>
<BR>
新生児から4ヶ月頃までは別売りの新生児用パッド<BR>
(インファントインサート)をご使用下さい。<BR>
<BR>
※日本語の説明書付き<BR>
※USA正規品を直接、海外より輸入した<BR>
　並行輸入品です。<BR><BR>
※細かいご質問をされましてもお答えし<BR>
　かねます。平行輸入品のため仕様の細部<BR>
　は把握しておりません。申し訳ござい<BR>
　ません。<BR>
<BR>
<BR>
こちらをクリック⇒インファントインサート<BR><BR>

